animal.description:
Emily is a very friendly, active, 4-month old puppy - she is very playful with lots of energy. Great with kids and other dogs.   She is really smart and very loving - please help her find her forever home! She'd do great with a family that is active and ideally has a fenced yard.  

Please visit our website at www.anlcf.org to complete an online application. Upon receipt, we will contact you to arrange an appointment in San Diego. Thank you!

